import React, { Component } from 'react';

class Feed extends Component {
  render() {
    return (
      <div>
        {this.state.feed.map(item => {
          return (
            <div className="App" key={item.id}>
              <h2>Usuario: {item.username}</h2>
              <h3>Tem {item.curtidas} curtidas</h3>
              <h3>Tem {item.comentarios} comentarios</h3>
              <p>-------------------------------------------------------</p>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Feed;
